const Main=()=>{
    const hanleLogout=()=>{
        localStorage.removeItem("token")
        window.location.reload()
    }
    return(
        <div className={styles.main_container}>
        <nav className={styles.navbar}>
            <h1>fakebook</h1>
            <button className={styles.white_btn} onClick={hanleLogout}>
                Logout
            </button>
        </nav>

        </div>
    )
}

export default index
